	/**
	 * 一遍循环即可
	 * @param s
	 * @return
	 */
	public static int lengthOfLongestSubstring(String s) {
		int max = 0;
		if (s.equals("")) { // 空字符串
			return 0;
		} 
		else if (s.length() == 1) { // 长度为1的字符串
			return 1;
		}  
		else { // 长度大于1的字符串
			Map<Object, Integer> map = new HashMap<Object, Integer>();
			int right = 0; // 右指针
			int left = 0; // 左指针，两个指针控制最大不重复子串
			map.put(s.charAt(right), 0);
			while(right < s.length() - 1){
				right++;
				char rightChar = s.charAt(right); // 右指针一直向前移动直到最后一个元素
				if (map.containsKey(rightChar)) {
					// 存在该元素，将左指针移动到之前出现该元素位置的右边一个下标
					if (left <= map.get(rightChar)) {
						left = map.get(rightChar) + 1;
					}
				}
				map.put(rightChar, right); // 不存在元素，将该元素及其下标加到数组中,存在则更新下标值
				if ((right - left + 1) > max) {
					max = right - left + 1;
				}
			}
			return max;
		}
    }
	
	/**
	 * 复杂度较高，两遍循环
	 * @param s
	 * @return
	 */
	public static int lengthOfLongestSubstring2(String s) {
		int max = 0;
		if (s.length() == 1) {
			return 1;
		}
		/**
		 * 循环遍历得到每个字符最大子串的长度
		 */
		for (int i = 0; i < s.length() - 1; i++) {
			char cur = s.charAt(i);
			// 循环该元素之后的元素，得到最大不重复长度
			String curs =  "" + cur;
			String scur = s.substring(i+1); // 该元素之后的元素为一个元素
			while (!scur.isEmpty() && !curs.contains(scur.charAt(0)+"")) {
				curs = curs + scur.charAt(0);
				scur = scur.substring(1);
			}
			int len = curs.length();
			if (len > max) { // 总是返回长度最大的数
				max = len;
			}
			if (max > s.length() - i) {
				break;
			}
			
		}
		
		Log.log("Longest Substring Without Repeating Characters Length: " + max);
		
		return max;
    }

